import React, { useEffect} from 'react';
import { Box, Card, CardActions, CardContent, CardMedia, Button, Typography } from '@mui/material';
import {
    Link,
    Route,
    Routes,
    useParams
} from "react-router-dom";


const Shop = ({ allData,isReady }) => {
    
    if (!isReady) 
    {
        return (
            <p>Loading.............</p>
        )
    }
    
        return (
            <Box className="allProduct_shop">
                {
                    allData.map(e => (
                        <Card className="childElementCard">
                            <CardActions>
                                <Link href="/shop"variant="body1"  underline="none">
                                    <CardMedia
                                        component="img"
                                        alt="This is product"
                                        className="imageCard"
                                    />
                                    <CardContent>
                                        <Typography gutterBottom variant="h6" component="div">
                                          {e.foodName}
                                        </Typography>
                                    </CardContent>
                                </Link>
                            </CardActions>
                        </Card>
                    ))
                }
            </Box>
           
        )
};

export default Shop;
